import React from 'react';
import { Link } from 'react-router-dom';
import './Documentation.css'

const Documentation = () => {

    return(    
       <div className="documentation">

            <div className="sm-extra-space">
                <br />
            </div> 

            <div classname="doc-content">
                <h2 className="category-title">Using the API</h2>
                <ul>                        
                    <li className="appendixLink"><Link to="/monitor"><strong>Data Retrieval:</strong> Walkthrough on pulling metric data from Azure Monitor</Link></li>
                    <li className="appendixLink"><Link to="/api_docs"><strong>Query Formatting:</strong> Describes formatting requirements for input parameters</Link></li>
                    <li className="appendixLink"><Link to="/api_use"><strong>API Information:</strong> Detailed documents describing API use</Link></li>
                    <li className="appendixLink"><strong>Swagger:</strong> API backend documentation (Update in progress)</li>
                </ul>
                <h2 className="category-title">Project Information</h2>
                <ul>
                    {/* <li className="appendixLink"><Link to="/kb_summary"><strong>Background Summary:</strong> Problem Space and Theory for Project Motivation</Link></li> */}
                    <li className="appendixLink"><Link to="kb_cite"><strong>Knowledge Base:</strong> Project Citations</Link></li>
                    {/* <li className="appendixLink"><Link to="case_study"><strong>Case Study:</strong> Project Overview and Recommendations</Link></li> */}
                </ul>
                <h2 className="category-title">Team Information and Progress</h2>
                <ul>
                    <li className="appendixLink"><a href="https://www.github.com/TeamAPI-2021"><strong>Team Information:</strong> GreenAI-API team GitHub</a></li>
                    <li className="appendixLink"><Link to="deck"><strong>Decks:</strong> Slide decks from Vertical presentation</Link></li>
                    {/* <li className="appendixLink"><Link to="miro"><strong>Miro:</strong> Relation diagram for API and UI</Link></li> */}
                </ul>
            </div>

        </div>
    );
}

export default Documentation;
